JSDEV.cad.addTimer({ wait:.3 }, function(){
  JSDEV.page = new JSDEV_Page();
  JSDEV.page.resize();
  JSDEV.page.show();
});


function JSDEV_Page() {
  
  this.pageScn = new THREE.Scene();
  this.pageCam = new THREE.PerspectiveCamera( 45, 1, .1, 500 );
  this.pageCam.position.y = .2;
  
  this.resize = function() {
    
    this.pageCam.aspect = JSDEV.vpAspect;
    this.pageCam.updateProjectionMatrix();
    
    if(this.fps)
      this.fps.rescale();
    
  }
   
  this.free = function() {


  }  
  
  this.show = function() {
  
    this.scn = new THREE.Mesh(new THREE.Geometry(),JSDEV.mat.def);
    var p = new THREE.Mesh( new THREE.PlaneGeometry(.2,.2), JSDEV.mat.def);
    for(var i=0;i<5000;i++) {

      p.position.set(Math.random()*20-10,Math.random()*.2,Math.random()*20-10);
      this.scn.geometry.mergeMesh( p );
      
    }
    this.pageScn.add( this.scn );
    
    this.grnd = new THREE.Mesh( new THREE.PlaneGeometry(20,20,50,50), JSDEV.mat.grnd);
    this.grnd.rotation.x = -1.57;
    this.scn.add( this.grnd );
    
    this.fps = new RJA_FPSForm();
    this.fps.parse();
    this.pageScn.add( this.fps.mesh );
 
    JSDEV.ctx.setClearColor( 0x223344 );
    JSDEV.ctx.clear();
    JSDEV.ctx.render( this.pageScn, this.pageCam );
    
    this.addEvents();
    
    JSDEV.vpWidth = 1;
    JSDEV.resize();

  }
  
  this.addEvents = function() {
    
    JSDEV.cad.addTimer({ name:'fps', delta:.1, sender:this.fps.frm }, function(p){
      
      var q = ~~(JSDEV.cad.fps.DFPS*10);
      this.fps.upd({src: 'fps: ' + ~~(q/10) + '.' + q%10});
        
    });

  }
  
  this.render = function() {
    
    if(!this.pageScn.children.length)
      return;
    
    JSDEV.ctx.clear();
    
    this.scn.rotation.y = Math.sin(JSDEV.cad.ct/10)/20;
    this.scn.position.set( Math.sin(JSDEV.cad.ct/3),0,Math.cos(JSDEV.cad.ct/5) );
    
    JSDEV.ctx.render( this.pageScn, this.pageCam );

  }

}

