function RJA_FPSForm() {

  this.hud = JSDEV.hud.test;
  this.dat = { size:-1, a:'lt', x:20, y:2, w:40, h:20, scale:1 };
  
  this.frm = {
    
    text_fps: { size:9, a:'lt', x:2, y:2, s:.35, cs:6 },

  }
  
  this.mat = new THREE.ShaderMaterial({
    uniforms: {
      alpha: { value: 1. }, 
      tex: { value: this.hud.diff }
    },
    vertexShader: 
      'varying vec2 vUv;' +
      'varying vec4 dat;' +
      'void main(){' +
      ' vUv=uv;' +
      ' dat=vec4(normal,position.z);' +
      ' gl_Position = modelViewMatrix * vec4(position.x/8191.,position.y/8191.,.0,1.);' +
      '}',
    fragmentShader:
      'uniform sampler2D tex;' +
      'uniform float alpha;' +
      'varying vec2 vUv;' +
      'varying vec4 dat;' +
      'void main(){' +
      ' vec4 tColor = texture2D(tex,vUv);' +
      ' float a = dat.a<1.1 ? tColor.r : dat.a<2.1 ? tColor.g : tColor.b;'+
      ' gl_FragColor = vec4(1.,1.,1., a*alpha);'+
      '}',
    transparent: true,
  });
  
  this.resize = function() {
  
    this.rescale();
  
  }
  
  this.free = function() {
    
    this.mat.dispose();
    this.mesh.geometry.dispose();
    this.mesh = null;
    
  }
  
  JSDEV_HUDPanel.call( this );
  
}
